import Craft from './Craft'

const AllCrafts = () => {

const [crafts, setCrafts] = useState([])

useEffect(() => {
    fetch('http://localhost:9292/crafts')
    .then((res) => res.json())
    .then((data) => setCrafts(data))

}, [])

const craftList = crafts.map((craft) => {< Craft />})



  return (
    <div>Crafts</div>
  )
}

export default AllCrafts
